 async (props: FacebookLoginPropsType) => {
  const { email, password, page } = props;
  // type email
  await typeInTheInputField({
    page,
    value: email,
    selector: 'input[name="email"]',
  });
  // type password
  await typeInTheInputField({
    page,
    selector: 'input[name="pass"]',
    value: password,
  });
  // clicking the login button
  await page.click("button[name=login]");
}
